import React from "react";
import Maching from "./Maching";
import Unmatch from "./Unmatch";


const Slot = (props) => {
    let x = props.x;
    let y = props.y;
    let z = props.z;

    return (
        (x===y) && (y===z)  ? <Maching /> : <Unmatch /> 
    ) ;
    
     
}

export default Slot;
